  return (
    <div>
         <BrowserRouter>
         <Navigation>

         </Navigation>
            <Routes>
              <Route path="/" element={<Home></Home>}></Route>
              <Route path="/my/cart" element={<Cart></Cart>}></Route>
              <Route path="/*" element={<Error></Error>}></Route>
            </Routes>
         </BrowserRouter>
    </div>
  )
}

export default App
